records.addlTxt:
Defendant Diangelo J Davis in court with attorney Reyna Ivonne Morales.  Joy Hammond appeared for the State of Wisconsin with student intern Lauren Maddente.  Deputy Court Clerk ssm.

AS TO COUNT 2:  Pursuant to plea negotiations and on motion of the State, Court ordered count dismissed and read-in.

AS TO COUNT 1:  Defendant changes his plea to GUILTY.  Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty.   Defendant advised that if not a United States Citizen, deportation is possible.  Court found that defendant knowingly, voluntarily and intelligently waived his rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  

Sentencing proceeded.  Statements by the State, defense and defendant.  Defendant sentenced to serve 3 MONTHS in the House of Correction with credit for 3 days time served.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 1 YEAR.
Conditions:
*  AODA assessment/treatment deemed appropriate;
*  Maintain absolute sobriety; to be monitored by random urine screens;
*  Perform 20 hours of community service;
*  Submit a DNA sample and pay the DNA surcharge;
*  Possess no firearms;
*  Obtain full time employment/participate in job search;
*  Pay all costs and surcharges or, if not paid, convert to a civil judgment.
